description:
Un point remarquable (PR), est un point du réseau identifié géographiquement et référencé, pour les besoins :  
\- de délimitation des sections d’accès au réseau définies par la tarification ;  
\- de tracé des sillons, en y associant des horaires de passage ou d’arrêt théoriques ;  
\- d’enregistrement de l’horaire de passage réel des trains (PR munis de balises BREHAT).  
Le référencement des PR s’appuie sur trois éléments principaux :  
\- un « code réseau » sur quatre caractères numériques (CR) ;  
\- un « code immuable » sur six caractères numériques (CI) ;  
\- un « code chantier » sur deux caractères alphanumériques (CH).
Ce jeu de donnée présente l’ensembles des points remarquables Ferro localisés .  
Un point remarquable peut-être localisée sur plusieurs lignes ou sur plusieurs voies.   
La Ferro localisation implique donc une multiplication des points remarquables dans le jeu de données par le nombre de lignes ou de voies auxquelles ils ont été affectés.   
Aucune restriction n'existe quant au type de lieu ou d'installation pouvant faire l’objet d’un PR.   
Le lieu peut être identifiable visuellement ou non.
